import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';
import Home from './pages/Home';
import Login from './pages/Login/Login';
import Signup from "./pages/Signup/Signup";
import UserDashboard from "./pages/UserDashboard/UserDashboard";
import { UserProvider } from './context/UserContext';
import './App.css';
import Wishlist from "./pages/Wishlist/Wishlist";
import AccountInformation from "./pages/AccountInformation/AccountInformation";
import Gold from './pages/Bullions/Gold';
import Silver from './pages/Bullions/Silver';
import Platinum from './pages/Bullions/Platinum';
import AddressBook from "./pages/AddressBook/AddressBook";
import ProductDetail from "./pages/ProductDetail/ProductDetail";
import CartPage from "./pages/CartPage/CartPage";
// import Checkout from './pages/Checkout/Checkout';
import { CartProvider} from "./context/CartContext";
import ShippingPage from './pages/Checkout/ShippingPage';
import ConfirmationPage from './pages/Checkout/ConfirmationPage';
import { AuthProvider } from './context/AuthContext';
import CustomerOrdersPage from "./pages/CustomerOrdersPage/CustomerOrdersPage";
import NewsLetterSubPage from "./pages/NewsLetterSubPage/NewsLetterSubPage";
import PaymentPage from "./pages/PaymentPage/PaymentPage";

const App: React.FC = () => {
    return (
        <AuthProvider>
        <UserProvider>
            <CartProvider>
                <Router>
                    <div className="app">
                        <Header />
                        <main>
                            <Routes>
                                <Route path="/" element={<Home />} />
                                <Route path="/login" element={<Login />} />
                                <Route path="/signup" element={<Signup />} />
                                <Route path="/user" element={<UserDashboard />} />
                                <Route path="/wishlist" element={<Wishlist />} />
                                <Route path="/guides/gold" element={<Gold />} />
                                <Route path="/guides/silver" element={<Silver />} />
                                <Route path="/guides/platinum" element={<Platinum />} />
                                <Route path="/AccountInformation" element={<AccountInformation />} />
                                <Route path="/AddressBook" element={<AddressBook />} />
                                <Route path="/product/:sku" element={<ProductDetail />} />
                                <Route path="/cart" element={<CartPage />} />
                                <Route path="/shipping" element={<ShippingPage />} />
                                <Route path="/confirmation" element={<ConfirmationPage />} />
                                <Route path="/Orders" element={<CustomerOrdersPage />} />
                                <Route path="/NewsLetterSubPage" element={<NewsLetterSubPage />} />
                                <Route path="/Payment" element={<PaymentPage />} />
                            </Routes>
                        </main>
                        <Footer />
                    </div>
                </Router>
            </CartProvider>
        </UserProvider>
        </AuthProvider>
    );
};

export default App;
